import Link from "next/link";
import axios from "axios";

export default function Details({ faqs }) {
  console.log(faqs);
  return (
    <div>
      <h1>Details Route</h1>
      <Link href='/'>
        <a>Go Back</a>
      </Link>
    </div>
  );
}

export const getStaticProps = async () => {
  const url = "http://localhost:5000/api/v1/fags";
  const faqs = await axios.get(url);

  return {
    props: { faqs },
  };
};
